import Table from "../../styled-components/Table";
import Typography from "../../styled-components/Typography";

export default function TableTop({game_status}) {
  // const startGame
  return (
    <Table top>
        <Typography link >
          start a new challenge
        </Typography>
        {game_status && (
          <>
        <Typography link href="/">
        get a hint
      </Typography>
      <Typography link href="/">
        skip
      </Typography>
      </>
        )}

    </Table>
  );
}
